import React from 'react'
import flavorgarlic from './flavorgarlic.png'

const Logo = props => {
    return (
        <div style={styles.container}>
            <img style={styles.flavor} src={flavorgarlic} alt="logo"/>
        </div>
    )
};

export default Logo

const styles = {
    container: {
        display: 'flex',
        flexFlow: 'row'
    },
    flavor: {
        width: '60%',
        margin: '0',
        padding: '0'
    },
    garlic: {
        width: '10%',
        height: '10%',
        margin: '0',
        verticalAlign: 'center'
    }
};
